int client_id;
int product_id;
int count;
public shopcar() {
	super();
	// TODO Auto-generated constructor stub
}
public int getID() {
	return ID;
}
public void setID(int iD) {
	ID = iD;
}
public int getClient_id() {
	return client_id;
}
